Chota Sipahi | 2005 | CFSI | 585 MB | E-Subs | DVDRip | Phantom

Joze is a young Goan boy growing up during the freedom movement of the state in the 60s. Though young and thus expected to remain ignorant of the political winds brewing all over, he becomes acutely aware of the grave injustice everywhere and the sacrifice made by those around him. This instills in him a sense of responsibility that becomes instrumental in saving many lives during a crucial military operation. 

The film won the child actor the award for the Best Child Artist at the 52nd National Film Awards in 2005.

